[Final response] To write a code for ESP32 that displays the temperature and address of Dallas 18B20 temperature sensors on the serial monitor, you can use the OneWire and DallasTemperature libraries. Here's a simple example of how you can achieve this:

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Data wire is connected to pin 2 on the Arduino
#define ONE_WIRE_BUS 2

// Create a DallasTemperature object
DallasTemperature sensors(&OneWire(ONE_WIRE_BUS));

void setup() {
  Serial.begin(9600);
  sensors.begin();
}

void loop() {
  // Start the temperature measurement
  sensors.requestTemperatures();

  // Loop through the sensors and print their addresses and temperatures
  for (uint8_t i = 0; i < sensors.getDeviceCount(); i++) {
    DeviceAddress deviceAddress = sensors.getAddress(i);
    float temperature = sensors.getTempCByIndex(i);

    Serial.print("Sensor ");
    Serial.print(i + 1);
    Serial.print(": ");
    Serial.print("Address: ");
    printAddress(deviceAddress);
    Serial.print(", Temperature: ");
    Serial.println(temperature);
  }

  delay(1000);
}

void printAddress(DeviceAddress deviceAddress) {
  for (uint8_t i = 0; i < 8; i++) {
    if (deviceAddress[i] < 16) {
      Serial.print("0");
    }
    Serial.print(deviceAddress[i], HEX);
    Serial.print(" ");
  }
}
```

This code assumes that you have connected the data wire of the Dallas 18B20 sensors to pin 2 of your ESP32. Make sure to install the OneWire and DallasTemperature libraries before uploading the code to your ESP32.

This code will display the address and temperature of each connected Dallas 18B20 sensor on the serial monitor every second. You can adjust the delay between readings as needed.

