También puedes pasar una función flecha como argumento a la función `.map()`:

```javascript
const numeros = [1, 2, 3, 4, 5];
const doble = numeros.map(numero => numero * 2);
console.log(doble); // [2, 4, 6, 8, 10]
```

Recuerda que la función que pasas a la función `.map()` debe devolver un valor para cada elemento del arreglo original. Si la función no devuelve un valor, la función `.map()` no agregará ese elemento al nuevo arreglo.

