[Final response] En Java, el operador `if` se utiliza para evaluar una condición y ejecutar un bloque de código si es verdadera. La sintaxis básica del operador `if` es la siguiente:
```
if (condición) {
 // Código a ejecutar si la condición es verdadera
}
```
Por ejemplo, si deseas verificar si un número es par, puedes utilizar el operador `if` de la siguiente manera:
```
int numero = 4;
if (numero % 2 == 0) {
 System.out.println("El número es par.");
}
```
En este ejemplo, la condición es `numero % 2 == 0`, que verifica si el resto de la división entre el número y 2 es 0, lo que indica que el número es par. Si la condición es verdadera, se ejecutará el bloque de código que imprime "El número es par."

También puedes utilizar el operador `else` para ejecutar un bloque de código si la condición es falsa. La sintaxis básica del operador `if-else` es la siguiente:
```
if (condición) {
 // Código a ejecutar si la condición es verdadera
} else {
 // Código a ejecutar si la condición es falsa
}
```
Por ejemplo, si deseas verificar si un número es par o impar, puedes utilizar el operador `if-else` de la siguiente manera:
```
int numero = 5;
if (numero % 2 == 0) {
 System.out.println("El número es par.");
} else {
 System.out.println("El número es impar.");
}
```
En este ejemplo, la condición es `numero % 2 == 0`, que verifica si el resto de la división entre el número y 2 es 0, lo que indica que el número es par. Si la condición es verdadera, se ejecutará el bloque de código que imprime "El número es par." Si la condición es falsa, se ejecutará el bloque de código que imprime "El número es impar."

